class Recipe {
    constructor(id, title, category, region, ingredients, imgUrl, videoUrl) {
        this.id = id
        this.title = title
        this.category = category
        this.region = region
        this.ingredients = ingredients
        this.imgUrl = imgUrl
        this.videoUrl = videoUrl
        this.favarite = false
        this.cheef = ""
        this.rate = 0
    }
   
}
